import React, { useState } from 'react';
import { Box, Button, Tabs, Tab, TextField, Alert, CircularProgress, Grid } from '@mui/material';
import { useNavigate } from 'react-router-dom';
import { storeToken,getAuthId, getTempUserDetails, removeAuthId, removeTempUserDetails } from '../../services/LocalStorage';
import { useVerifyOTPMutation } from '../../services/authApi';

const Userregverify = () => {
  const [value, setValue] = useState(0);
  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  const [authid, setAuthId] = useState(getAuthId());
  const [error, setError] = useState({
    status: false,
    msg: '',
    type: '',
  });

  const [verifyOTP, { isLoading }] = useVerifyOTPMutation();
  const navigate = useNavigate();
  const actualData = getTempUserDetails();

  const handleVerifyOTP = async (e) => {
    e.preventDefault();
    const data = new FormData(e.currentTarget);
    const getActualData = {
      actualData,
      otp: data.get('otp'),
      email: authid,
    };

    if (getActualData.otp && getActualData.email) {
      try {
        const res = await verifyOTP(getActualData).unwrap();
        console.log('Response:', res);

        if (res && res.data && res.data.status === 'success') {
          setError({ status: true, msg: res.data.message, type: 'success' });
          storeToken(res.data.token); // Ensure you store the token if needed
          removeAuthId();
          removeTempUserDetails();
          setTimeout(() => {
            navigate('/LogReg');
            window.location.reload();
          }, 4000);
        } else {
          console.error('Error during OTP verification:', res.data.message);
          setError({ status: true, msg: res.data.message, type: 'error' });
        }
      } catch (error) {
        console.error('Error during OTP verification:', error);
        setError({ status: true, msg: 'Error occurred during OTP verification', type: 'error' });
      }
    } else {
      setError({ status: true, msg: 'OTP and email are required', type: 'error' });
    }
  };

  return (
    <>
      <Grid
        container
        justifyContent="center"
        alignItems="center"
        textshadow="3px 2px 2px white"
        display="flex"
        flexDirection="column"
        sx={{
          background: 'linear-gradient(to right, black, purple, navy, black)',
          backgroundSize: 'cover',
          backgroundPosition: 'center',
          backgroundRepeat: 'no-repeat',
          minHeight: '100vh',
          padding: 2,
        }}
      >
        <Grid
          item
          xs={12}
          sm={8}
          md={6}
          lg={4}
          sx={{
            background: 'rgba(255, 255, 255, 0.8)',
            border: '2px solid rgba(0, 0, 0, 0.5)',
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            justifyContent: 'center',
            padding: 3,
            borderRadius: 8,
            backdropFilter: 'blur(20px)',
            boxShadow: 3,
            textAlign: 'center',
          }}
        >
          <Box sx={{ width: '100%' }}>
            <Tabs
              value={value}
              onChange={handleChange}
              centered
              TabIndicatorProps={{
                style: {
                  backgroundColor: 'navy',
                },
              }}
              sx={{ marginBottom: 2 }}
            >
              <Tab label="Verify OTP" sx={{ textTransform: 'none', fontWeight: 'bold', color: 'navy' }} />
            </Tabs>
            <Box component="form" sx={{ p: 3, display: 'flex', justifyContent: 'center' }} noValidate id="verify-otp-regform" onSubmit={handleVerifyOTP}>
              <TextField id="otp" name="otp" required fullWidth margin="normal" label="Enter OTP" />
              <br />
              <Box sx={{ m: 2, display: 'flex', justifyContent: 'center' }}>
                {isLoading ? <CircularProgress /> : <Button type="submit" variant="contained" color="info">Verify</Button>}
                {error.status && <Alert severity={error.type} sx={{ textAlign: 'center' }}>{error.msg}</Alert>}
              </Box>
            </Box>
          </Box>
        </Grid>
      </Grid>
    </>
  );
};

export default Userregverify;
